industry_description:
This industry comprises establishments primarily engaged in one or more of the following: (1) growing vegetable and/or melon crops; (2) producing vegetable and/or melon seeds; and (3) growing vegetable and/or melon bedding plants. The crops included in this industry have an annual growth cycle and are grown in open fields. Climate and cultural practices limit producing areas but often permit the growing of a combination of crops in a year.
Cross-References. Establishments primarily engaged in--
 Growing sugar beets--are classified in Industry 11199, All Other Crop Farming;
 Growing vegetables and melons under glass or protective cover--are classified in Industry 11141, Food Crops Grown Under Cover;
 Growing dry peas and beans--are classified in Industry 11113, Dry Pea and Bean Farming;
 Growing corn (except sweet corn)--are classified in Industry 11115, Corn Farming;
 Canning, pickling, and/or drying (artificially) vegetables--are classified in Industry 31142, Fruit and Vegetable Canning, Pickling, and Drying; and
 Growing fruit on trees and other fruit-bearing plants (except melons)--are classified in Industry Group 1113, Fruit and Tree Nut Farming.

This industry comprises establishments primarily engaged in (1) growing crops (except oilseeds and/or grains; vegetables and/or melons; fruits and/or tree nuts; greenhouse, nursery, and/or floriculture products; tobacco; cotton; sugarcane; or hay) or (2) growing a combination of crops (except a combination of oilseed(s) and grain(s); and a combination of fruit(s) and tree nut(s)) with no one crop or family of crops accounting for one-half of the establishments agricultural production (i.e., value of crops for market).
                Agave farming
Spice farming
General combination crop farming (except oilseed and grain; vegetables and melons; fruit and nut combinations)
Tea farming
Hay seed farming
Maple sap gathering
Peanut farming
Sugar beet farming
Grass seed farming
Cross-References. Establishments primarily engaged in--
 Growing oilseeds and/or wheat, corn, rice, or other grains--are classified in Industry Group 1111, Oilseed and Grain Farming;
 Growing vegetables and/or melons--are classified in Industry Group 1112, Vegetable and Melon Farming;
 Growing fruits and/or tree nuts--are classified in Industry Group 1113, Fruit and Tree Nut Farming;
 Growing greenhouse, nursery, and/or floriculture products--are classified in Industry Group 1114, Greenhouse, Nursery, and Floriculture Production;
 Growing tobacco--are classified in Industry 11191, Tobacco Farming;
 Growing cotton--are classified in Industry 11192, Cotton Farming;
 Growing sugarcane--are classified in Industry 11193, Sugarcane Farming;
 Growing hay--are classified in Industry 11194, Hay Farming; and
 Growing algae, seaweed, or other aquatic plants--are classified in Industry 11251, Aquaculture.

This U.S. industry comprises establishments primarily engaged in one of the following: (1) growing crops (except oilseeds and/or grains; vegetables and/or melons; fruits and/or tree nuts; greenhouse, nursery, and/or floriculture products; tobacco; cotton; sugarcane; hay; sugar beets; or peanuts); (2) growing a combination of crops (except a combination of oilseed(s) and grain(s); and a combination of fruit(s) and tree nut(s)) with no one crop or family of crops accounting for one-half of the establishments agricultural production (i.e., value of crops for market); or (3) gathering tea or maple sap.
Illustrative Examples:
Agave farming
Mint farming
General combination crop farming (except oilseed and grain; vegetables and melons; fruit and tree nut combinations)
Hay seed farming
Grass seed farming
Hop farming
Spice farming
Cross-References. Establishments primarily engaged in--
 Growing oilseeds and/or wheat, corn, rice, or other grains--are classified in Industry Group 1111, Oilseed and Grain Farming;
 Growing vegetables and/or melons--are classified in Industry Group 1112, Vegetable and Melon Farming;
 Growing fruits and/or tree nuts--are classified in Industry Group 1113, Fruit and Tree Nut Farming;
 Growing greenhouse, nursery, and/or floriculture products--are classified in Industry Group 1114, Greenhouse, Nursery, and Floriculture Production;
 Growing tobacco--are classified in Industry 111910, Tobacco Farming;
 Growing cotton--are classified in Industry 111920, Cotton Farming;
 Growing sugarcane--are classified in Industry 111930, Sugarcane Farming;
 Growing hay--are classified in Industry 111940, Hay Farming;
 Growing sugar beets--are classified in U.S. Industry 111991, Sugar Beet Farming;
 Growing peanuts--are classified in U.S. Industry 111992, Peanut Farming; and
 Growing algae, seaweed, or other aquatic plants--are classified in U.S. Industry 112519, Other Aquaculture.

This U.S. industry comprises establishments primarily engaged in (1) farm raising of aquatic animals (except finfish and shellfish) and/or (2) farm raising of aquatic plants. Alligator, algae, frog, seaweed, or turtle production is included in this industry.
Cross-References. Establishments primarily engaged in--
 Miscellaneous fishing activities, such as catching or taking of terrapins, turtles, and frogs from their natural habitat--are classified in U.S. Industry 114119, Other Marine Fishing;
 Farm raising finfish--are classified in U.S. Industry 112511, Finfish Farming and Fish Hatcheries;
 Farm raising shellfish--are classified in U.S. Industry 112512, Shellfish Farming; and
 Growing hydroponic crops--are classified in U.S. Industry 111419, Other Food Crops Grown Under Cover.

This industry comprises establishments primarily engaged in (1) raising animals (except cattle, hogs and pigs, poultry, sheep and goats, aquaculture, apiculture, horses and other equines; and fur-bearing animals including rabbits) or (2) raising a combination of animals, with no one animal or family of animals accounting for one-half of the establishments agricultural production (i.e., value of animals for market).
Illustrative Examples:
Bird production (e.g., canaries, parakeets, parrots)
Laboratory animal production (e.g., rats, mice, guinea pigs)
Combination animal farming (except dairy, poultry)
Companion animals production (e.g., cats, dogs)
Worm production
Deer production
Llama production
Cross-References. Establishments primarily engaged in--
 Raising cattle, dairy cattle, or feeding cattle for fattening--are classified in Industry Group 1121, Cattle Ranching and Farming;
 Raising hogs and pigs--are classified in Industry Group 1122, Hog and Pig Farming;
Raising poultry and raising poultry for egg production--are classified in Industry Group 1123, Poultry and Egg Production;
 Raising sheep and goats--are classified in Industry Group 1124, Sheep and Goat Farming;
 Animal aquaculture--are classified in Industry 11251, Aquaculture;
 Raising bees--are classified in Industry 112910, Apiculture;
 Raising horses and other equines--are classified in Industry 112920, Horses and Other Equine Production; and
 Raising fur-bearing animals including rabbits--are classified in Industry 112930, Fur-Bearing Animal and Rabbit Production.

This industry comprises establishments primarily engaged in providing support activities for growing crops.
Illustrative Examples:
Aerial crop dusting or spraying (i.e., using specialized or dedicated aircraft)
Farm management services
Cotton ginning
Planting crops
Cultivating services
Vineyard cultivation services
Cross-References. Establishments primarily engaged in--
 Performing crop production that are generally known as farms, orchards, groves, or vineyards (including tenant farms)--are classified in the appropriate crop industry within Subsector 111, Crop Production;
 Providing support activities for forestry--are classified in Industry 11531, Support Activities for Forestry;
 Landscaping and horticultural services, such as lawn and maintenance care and ornamental shrub and tree services--are classified in Industry 56173, Landscaping Services;
 Land clearing, land leveling, and earth moving for terracing, ponds, and irrigation--are classified in Industry 23891, Site Preparation Contractors;
 Artificially drying and dehydrating fruits and vegetables--are classified in Industry 31142, Fruit and Vegetable Canning, Pickling, and Drying;
 Stemming and redrying tobacco--are classified in Industry 31223, Tobacco Manufacturing;
 Providing water for irrigation--are classified in Industry 22131, Water Supply and Irrigation Systems; and
 Buying farm products, such as fruits or vegetables, for resale to other wholesalers or retailers, and preparing them for market or further processing--are classified in Industry 42448, Fresh Fruit and Vegetable Merchant Wholesalers.

This U.S. industry comprises establishments primarily engaged in performing services on crops, subsequent to their harvest, with the intent of preparing them for market or further processing. These establishments provide postharvest activities, such as crop cleaning, sun drying, shelling, fumigating, curing, sorting, grading, packing, and cooling.
Cross-References. Establishments primarily engaged in--
 Ginning cotton--are classified in U.S. Industry 115111, Cotton Ginning;
 Custom grain grinding for animal feed--are classified in U.S. Industry 311119, Other Animal Food Manufacturing;
 Artificially drying and dehydrating fruits and vegetables--are classified in U.S. Industry 311423, Dried and Dehydrated Food Manufacturing;
 Stemming and redrying tobacco--are classified in Industry 312230, Tobacco Manufacturing;
 Buying farm products for resale to other wholesalers or retailers and preparing them for market or further processing--are classified in Industry 424480, Fresh Fruit and Vegetable Merchant Wholesalers; and
 Providing farm management services (i.e., on a contract or fee basis) and arranging or contracting postharvesting crop activities for the farm(s) they manage--are classified in U.S. Industry 115116, Farm Management Services.

This industry comprises establishments primarily engaged in (1) the exploration, development, and/or the production of natural gas from wells in which the hydrocarbons will initially flow or can be produced using normal or enhanced drilling and extraction techniques or (2) the recovery of liquid hydrocarbons from oil and gas field gases. Establishments primarily engaged in sulfur recovery from natural gas are included in this industry.
Cross-References. Establishments primarily engaged in--
 Performing gas field services for operators on a contract or fee basis--are classified in Industry 21311, Support Activities for Mining;
 Manufacturing acyclic and cyclic hydrocarbons from refined petroleum or converting refined petroleum into liquid hydrocarbons (i.e., petrochemicals)--are classified in Industry 325110, Petrochemical Manufacturing;
 Refining crude petroleum into refined petroleum and liquid hydrocarbons--are classified in Industry 324110, Petroleum Refineries; and
 Recovering helium from natural gas--are classified in Industry 325120, Industrial Gas Manufacturing.

This industry comprises establishments primarily engaged in developing the mine site, mining, and/or milling or otherwise beneficiating (i.e., preparing) nonmetallic minerals (except coal, stone, sand, gravel, clay, ceramic, and refractory minerals).
Illustrative Examples:
Barite mining and/or beneficiating
Phosphate rock mining and/or beneficiating
Borate, natural, mining and/or beneficiating
Potash mining and/or beneficiating
Peat mining and/or beneficiating
Rock salt mining and/or beneficiating
Cross-References. Establishments primarily engaged in--
 Mining or quarrying dimension stone--are classified in Industry 21231, Stone Mining and Quarrying;
 Mining or quarrying sand, gravel, clay, and ceramic and refractory minerals--are classified in Industry 21232, Sand, Gravel, Clay, and Ceramic and Refractory Minerals Mining and Quarrying;
 Calcining, dead burning, or otherwise processing (i.e., beyond basic preparation) minerals, such as talc, mica, feldspar, barite, and soapstone--are classified in Industry 32799, All Other Nonmetallic Mineral Product Manufacturing;
 Manufacturing boron compounds and potassium salts--are classified in Industry 32518, Other Basic Inorganic Chemical Manufacturing;
 Manufacturing table salt--are classified in Industry 31194, Seasoning and Dressing Manufacturing;
 Manufacturing salt (except table salt)--are classified in Industry 32599, All Other Chemical Product and Preparation Manufacturing; and
 Manufacturing phosphoric acid, superphosphates, or other phosphatic fertilizer materials--are classified in Industry 32531, Fertilizer Manufacturing.

This industry comprises establishments primarily engaged in providing support services, on a contract or fee basis, required for the mining and quarrying of minerals and for the extraction of oil and gas. Drilling, taking core samples, and making geological observations at prospective sites (except geophysical surveying and mapping) for minerals, on a contract or fee basis, are included in this industry.
Cross-References. Establishments primarily engaged in--
 Performing geophysical surveying and mapping services for minerals (i.e., coal, metal ores, oil and gas, and nonmetallic minerals) on a contract or fee basis--are classified in Industry 54136, Geophysical Surveying and Mapping Services;
 Mining, quarrying, and/or beneficiating on a contract or fee basis--are classified in Subsector 212, Mining (except Oil and Gas), based on the mineral mined;
 Operating oil and gas field properties on a contract or fee basis--are classified in Subsector 211, Oil and Gas Extraction, based on the activity;
 Oil and gas pipeline and related structures construction and repair--are classified in Industry 23712, Oil and Gas Pipeline and Related Structures Construction;
 Site preparation and related construction activities on a contract or fee basis--are classified in Industry 23891, Site Preparation Contractors; and
 Mining machinery and equipment repair and maintenance--are classified in Industry 81131, Commercial and Industrial Machinery and Equipment (except Automotive and Electronic) Repair and Maintenance.

This U.S. industry comprises establishments primarily engaged in performing support activities on a contract or fee basis for oil and gas operations (except site preparation and related construction activities). Services included are exploration (except geophysical surveying and mapping); excavating slush pits and cellars, well surveying; running, cutting, and pulling casings, tubes, and rods; cementing wells, shooting wells; perforating well casings; acidizing and chemically treating wells; and cleaning out, bailing, and swabbing wells.
Cross-References. Establishments primarily engaged in--
 Contract drilling for oil and gas--are classified in U.S. Industry 213111, Drilling Oil and Gas Wells;
 Operating oil and gas field properties on a contract or fee basis--are classified in Industry Group 2111, Oil and Gas Extraction;
 Performing geophysical surveying and mapping services for oil and gas on a contract or fee basis--are classified in Industry 541360, Geophysical Surveying and Mapping Services;
 Oil and gas pipeline and related structures construction and repair--are classified in Industry 237120, Oil and Gas Pipeline and Related Structures Construction;
 Inspecting pipelines--are classified in Industry 541990, All Other Professional, Scientific, and Technical Services;
 Site preparation and related construction activities on a contract or fee basis--are classified in Industry 238910, Site Preparation Contractors; and
 Mining machinery and equipment repair and maintenance--are classified in Industry 811310, Commercial and Industrial Machinery and Equipment (except Automotive and Electronic) Repair and Maintenance.

This U.S. industry comprises establishments primarily engaged in operating electric power generation facilities (except hydroelectric, fossil fuel, nuclear, solar, wind, geothermal, biomass). These facilities convert other forms of energy, such as tidal power, into electric energy. The electric energy produced in these establishments is provided to electric power transmission systems or to electric power distribution systems.
Cross-References. Establishments primarily engaged in--
 Operating trash disposal incinerators that also generate electricity--are classified in U.S. Industry 562213, Solid Waste Combustors and Incinerators;
 Operating hydroelectric power generation facilities--are classified in U.S. Industry 221111, Hydroelectric Power Generation;
 Operating fossil fuel powered electric power generation facilities--are classified in U.S. Industry 221112, Fossil Fuel Electric Power Generation;
 Operating nuclear electric power generation facilities--are classified in U.S. Industry 221113, Nuclear Electric Power Generation;
 Operating solar electric power generation facilities--are classified in U.S. Industry 221114, Solar Electric Power Generation;
 Operating wind electric power generation facilities--are classified in U.S. Industry 221115, Wind Electric Power Generation;
 Operating geothermal electric power generation facilities--are classified in U.S. Industry 221116, Geothermal Electric Power Generation; and
 Operating biomass electric power generation facilities--are classified in U.S. Industry 221117, Biomass Electric Power Generation.

This U.S. industry comprises general contractor establishments primarily responsible for the entire construction of new single-family housing, such as single-family detached houses and town houses or row houses where each housing unit (1) is separated from its neighbors by a ground-to-roof wall and (2) has no housing units constructed above or below. This industry includes general contractors responsible for the on-site assembly of modular and prefabricated houses. Single-family housing design-build firms and single-family construction management firms acting as general contractors are included in this industry.
Cross-References. Establishments primarily engaged in--
 Building single-family houses on their own account for sale as speculative builders or merchant builders--are classified in U.S. Industry 236117, New Housing For-Sale Builders;
 Remodeling or repairing existing houses and other residential buildings--are classified in U.S. Industry 236118, Residential Remodelers;
 Performing manufactured (mobile) home set up and tie-down work--are classified in Industry 238990, All Other Specialty Trade Contractors;
 Performing specialized construction work on houses and other residential buildings, generally on a subcontract basis--are classified in Subsector 238, Specialty Trade Contractors; and
 Constructing and leasing residential buildings on their own account--are classified in Industry 531110, Lessors of Residential Buildings and Dwellings.

This U.S. industry comprises general contractor establishments primarily responsible for the construction of new multifamily residential housing units (e.g., high-rise, garden, town house apartments, and condominiums where each unit is not separated from its neighbors by a ground-to-roof wall). Multifamily design-build firms and multifamily housing construction management firms acting as general contractors are included in this industry.
Cross-References. Establishments primarily engaged in--
 Building multifamily buildings on their own account for sale as speculative builders or merchant builders--are classified in U.S. Industry 236117, New Housing For-Sale Builders;
Remodeling or repairing existing multifamily housing and other residential buildings--are classified in U.S. Industry 236118, Residential Remodelers;
 Performing specialized construction work on multifamily housing and other residential buildings, generally on a subcontract basis--are classified in Subsector 238, Specialty Trade Contractors; and
 Constructing and leasing residential buildings on their own account--are classified in Industry 531110, Lessors of Residential Buildings and Dwellings.

This U.S. industry comprises establishments primarily engaged in building new homes on land that is owned or controlled by the builder rather than the homebuyer or investor. The land is included with the sale of the home. Establishments in this industry build single-family and/or multifamily homes. These establishments are often referred to as merchant builders, but are also known as production or for-sale builders.
Cross-References. Establishments primarily engaged in--
 Building single-family houses for others as general contractors--are classified in U.S. Industry 236115, New Single-Family Housing Construction (except For-Sale Builders);
 Building multifamily residential buildings for others as general contractors--are classified in U.S. Industry 236116, New Multifamily Housing Construction (except For-Sale Builders);
 Remodeling or repairing existing houses and other residential buildings, either for others or on own account for sale--are classified in U.S. Industry 236118, Residential Remodelers;
 Performing specialized construction work on houses or other residential buildings, generally on a subcontract basis--are classified in Subsector 238, Specialty Trade Contractors; and
 Constructing and leasing residential buildings on their own account--are classified in Industry 531110, Lessors of Residential Buildings and Dwellings.

This U.S. industry comprises establishments primarily responsible for the remodeling construction (including additions, alterations, reconstruction, maintenance, and repairs) of houses and other residential buildings, single-family and multifamily. Included in this industry are remodeling general contractors, for-sale remodelers, remodeling design-build firms, and remodeling project construction management firms.
Cross-References. Establishments primarily engaged in--
 Building single-family houses for others as general contractors--are classified in U.S. Industry 236115, New Single-Family Housing Construction (except For-Sale Builders);
 Building multifamily buildings for others as general contractors--are classified in U.S. Industry 236116, New Multifamily Housing Construction (except For-Sale Builders);
 Building houses or other residential buildings, on their own account for sale as speculative builders or merchant builders--are classified in U.S. Industry 236117, New Housing For-Sale Builders;
 Remodeling nonresidential buildings--are classified in Industry Group 2362, Nonresidential Building Construction, based on the type of structure being remodeled;
 Performing specialized construction work on houses or other residential buildings, generally on a subcontract basis--are classified in Subsector 238, Specialty Trade Contractors; and
 Constructing and leasing residential buildings on their own account--are classified in Industry 531110, Lessors of Residential Buildings and Dwellings.

This industry comprises establishments primarily engaged in servicing land and subdividing real property into lots, for subsequent sale to builders. Servicing of land may include excavation work for the installation of roads and utility lines. The extent of work may vary from project to project. Land subdivision precedes building activity and the subsequent building is often residential, but may also be commercial tracts and industrial parks. These establishments may do all the work themselves or subcontract the work to others. Establishments that perform only the legal subdivision of land are not included in this industry.
Cross-References. Establishments primarily engaged in--
 Constructing buildings, for sale, on lots they subdivide--are classified based on the type of construction project, in Industry Group 2361, Residential Building Construction, or Industry Group 2362, Nonresidential Building Construction;
 Installing roads on a subcontract basis for land subdividers--are classified in Industry 237310, Highway, Street, and Bridge Construction;
Installing utilities on a subcontract basis for land subdividers--are classified in Industry Group 2371, Utility System Construction;
 Preparing land owned by others for building construction--are classified in Industry 238910, Site Preparation Contractors;
 Constructing buildings, for rent or lease, on lots they subdivide--are classified in Industry Group 5311, Lessors of Real Estate;
 Subdividing and servicing land for cemetery development--are classified in Industry 812220, Cemeteries and Crematories; and
 Legal subdivision of land without land preparation--are classified elsewhere in the classification system based on the primary activity of the establishment.

This industry comprises establishments primarily engaged in building foundation and structure trades work (except poured concrete, structural steel, precast concrete, framing, masonry, glass and glazing, roofing, and siding). The work performed may include new work, additions, alterations, maintenance, and repairs.
Illustrative Examples:
Curtain wall, metal, installation
Forms for poured concrete, erecting and dismantling
Welding, on-site, contractors
Ornamental metal work installation
Fire escape installation
Decorative steel and wrought iron work installation
Cross-References. Establishments primarily engaged in--
 Poured concrete foundation and structure work--are classified in Industry 238110, Poured Concrete Foundation and Structure Contractors;
 Installation of structural steel or precast concrete building components--are classified in Industry 238120, Structural Steel and Precast Concrete Contractors;
 Framing buildings--are classified in Industry 238130, Framing Contractors;
 Masonry work--are classified in Industry 238140, Masonry Contractors;
 Glass and glazing work--are classified in Industry 238150, Glass and Glazing Contractors;
 Installing or repairing roofs--are classified in Industry 238160, Roofing Contractors;
 Installing siding--are classified in Industry 238170, Siding Contractors; and
 Fireproofing buildings--are classified in Industry 238310, Drywall and Insulation Contractors.

This industry comprises establishments primarily engaged in one or more of the following: (1) milling flour or meal from grains or vegetables; (2) preparing flour mixes or doughs from flour milled in the same establishment; (3) milling, cleaning, and polishing rice; and (4) manufacturing malt from barley, rye, or other grains.
Cross-References. Establishments primarily engaged in--
 Preparing breakfast cereals from flour milled in the same establishment--are classified in Industry 31123, Breakfast Cereal Manufacturing;
 Crushing soybeans or wet milling corn and vegetables--are classified in Industry 31122, Starch and Vegetable Fats and Oils Manufacturing;
 Manufacturing prepared flour mixes or doughs from flour ground elsewhere--are classified in Industry 31182, Cookie, Cracker, and Pasta Manufacturing;
 Brewing malt beverages--are classified in Industry 31212, Breweries;
 Mixing purchased dried and dehydrated ingredients with purchased rice--are classified in Industry 31199, All Other Food Manufacturing;
 Drying and/or dehydrating ingredients and packaging them with purchased rice--are classified in Industry 31142, Fruit and Vegetable Canning, Pickling, and Drying; and
 Manufacturing malt extract and syrups--are classified in Industry 31194, Seasoning and Dressing Manufacturing.

This U.S. industry comprises establishments primarily engaged in (1) milling flour or meal from grains (except rice) or vegetables and/or (2) milling flour and preparing flour mixes or doughs.
Cross-References. Establishments primarily engaged in--
 Preparing breakfast cereals from flour milled in the same establishment--are classified in Industry 311230, Breakfast Cereal Manufacturing;
 Manufacturing prepared flour mixes or doughs from flour ground elsewhere--are classified in U.S. Industry 311824, Dry Pasta, Dough, and Flour Mixes Manufacturing from Purchased Flour;
 Milling rice or cleaning and polishing rice--are classified in U.S. Industry 311212, Rice Milling;
 Wet milling corn and vegetables--are classified in U.S. Industry 311221, Wet Corn Milling; and
 Crushing soybeans and extracting soybean oil--are classified in U.S. Industry 311224, Soybean and Other Oilseed Processing.

This industry comprises establishments primarily engaged in one or more of the following: (1) wet milling corn and vegetables; (2) crushing oilseeds and tree nuts; (3) refining and/or blending vegetable oils; (4) manufacturing shortening and margarine; and (5) blending purchased animal fats with vegetable fats.
Cross-References. Establishments primarily engaged in--
 Manufacturing table syrups from corn syrup and starch base dessert powders--are classified in Industry 31199, All Other Food Manufacturing;
 Reducing maple sap to maple syrup--are classified in Industry 11199, All Other Crop Farming;
 Milling flour or meal from grains and vegetables--are classified in Industry 31121, Flour Milling and Malt Manufacturing;
 Wet milling corn to produce nonpotable ethyl alcohol--are classified in Industry 32519, Other Basic Organic Chemical Manufacturing;
 Rendering or refining animal fats and oils--are classified in Industry 31161, Animal Slaughtering and Processing; and
 Manufacturing laundry starches--are classified in Industry 32561, Soap and Cleaning Compound Manufacturing.

This U.S. industry comprises establishments primarily engaged in wet milling corn and other vegetables (except to make ethyl alcohol). Examples of products made in these establishments are corn sweeteners, such as glucose, dextrose, and fructose; corn oil; and starches (except laundry).
              Cross-References. Establishments primarily engaged in--
 Refining and/or blending corn oil from purchased oils--are classified in U.S. Industry 311225, Fats and Oils Refining and Blending;
 Manufacturing sweetening syrups from corn syrup and starch base dessert powders--are classified in U.S. Industry 311999, All Other Miscellaneous Food Manufacturing;
 Reducing maple sap to maple syrup--are classified in U.S. Industry 111998, All Other Miscellaneous Crop Farming;
 Milling (except wet milling) corn--are classified in U.S. Industry 311211, Flour Milling;
 Wet milling corn to produce nonpotable ethyl alcohol--are classified in U.S. Industry 325193, Ethyl Alcohol Manufacturing; and
 Manufacturing laundry starches--are classified in U.S. Industry 325612, Polish and Other Sanitation Good Manufacturing.

This industry comprises establishments primarily engaged in manufacturing breakfast cereal foods.
Cross-References. Establishments primarily engaged in--
 Manufacturing nonchocolate-coated granola bars and other types of breakfast bars--are classified in Industry 311340, Nonchocolate Confectionery Manufacturing;
 Manufacturing chocolate-coated granola bars from purchased chocolate--are classified in U.S. Industry 311352, Confectionery Manufacturing from Purchased Chocolate;
 Manufacturing chocolate-coated granola bars from cacao beans--are classified in U.S. Industry 311351, Chocolate and Confectionery Manufacturing from Cacao Beans; and
 Manufacturing coffee substitutes from grain--are classified in Industry 311920, Coffee and Tea Manufacturing.

This industry comprises establishments primarily engaged in manufacturing raw sugar, liquid sugar, and refined sugar from sugarcane, raw cane sugar and sugar beets.
Cross-References. Establishments primarily engaged in--
 Manufacturing corn sweeteners by wet milling corn--are classified in Industry 31122, Starch and Vegetable Fats and Oils Manufacturing;
 Manufacturing table syrups from corn syrup and starch base dessert powders--are classified in Industry 31199, All Other Food Manufacturing;
 Reducing maple sap to maple syrup or maple sugar--are classified in Industry 11199, All Other Crop Farming; and
 Manufacturing synthetic sweeteners (i.e., sweetening agents), such as saccharin and sugar substitutes (i.e., synthetic sweetener blended with other ingredients)--are classified in Subsector 325, Chemical Manufacturing.

This U.S. industry comprises establishments primarily engaged in manufacturing refined beet sugar from sugar beets.
Cross-References. Establishments primarily engaged in--
 Manufacturing raw cane sugar and/or refined cane sugar--are classified in U.S. Industry 311314, Cane Sugar Manufacturing;
 Manufacturing corn sweeteners by wet milling corn--are classified in U.S. Industry 311221, Wet Corn Milling;
 Manufacturing table syrups from corn syrup--are classified in U.S. Industry 311999, All Other Miscellaneous Food Manufacturing;
 Reducing maple sap to maple syrup or maple sugar--are classified in U.S. Industry 111998, All Other Miscellaneous Crop Farming; and
 Manufacturing synthetic sweeteners (i.e., sweetening agents), such as saccharin and sugar substitutes (i.e., synthetic sweetener blended with other ingredients)--are classified in Subsector 325, Chemical Manufacturing.

This U.S. industry comprises establishments primarily engaged in (1) processing sugarcane and/or (2) refining cane sugar from raw cane sugar.
Cross-References. Establishments primarily engaged in--
 Manufacturing beet sugar--are classified in U.S. Industry 311313, Beet Sugar Manufacturing;
 Manufacturing corn sweeteners by wet milling corn--are classified in U.S. Industry 311221, Wet Corn Milling;
 Reducing maple sap to maple syrup or maple sugar--are classified in U.S. Industry 111998, All Other Miscellaneous Crop Farming;
 Manufacturing table syrups from corn syrup--are classified in U.S. Industry 311999, All Other Miscellaneous Food Manufacturing; and
 Manufacturing synthetic sweeteners (i.e., sweetening agents), such as saccharin and sugar substitutes (i.e., synthetic sweetener blended with other ingredients)--are classified in Subsector 325, Chemical Manufacturing.

This industry comprises establishments primarily engaged in manufacturing nonchocolate confectioneries. Included in this industry are establishments primarily engaged in retailing nonchocolate confectionery products not for immediate consumption made on the premises.
Cross-References. Establishments primarily engaged in--
 Manufacturing chocolate confectioneries from cacao beans--are classified in U.S. Industry 311351, Chocolate and Confectionery Manufacturing from Cacao Beans;
 Manufacturing chocolate confectioneries from chocolate made elsewhere--are classified in U.S. Industry 311352, Confectionery Manufacturing from Purchased Chocolate;
 Retailing confectioneries not for immediate consumption made elsewhere--are classified in U.S. Industry 445292, Confectionery and Nut Stores;
