 Canning fruit and vegetable juices--are classified in Industry 31142, Fruit and Vegetable Canning, Pickling, and Drying;
 Manufacturing soft drink bases--are classified in Industry 31193, Flavoring Syrup and Concentrate Manufacturing;
 Manufacturing nonalcoholic cider--are classified in Industry 31194, Seasoning and Dressing Manufacturing;
 Manufacturing dry ice--are classified in Industry 32512, Industrial Gas Manufacturing;
 Manufacturing milk based drinks--are classified in Industry 31151, Dairy Product (except Frozen) Manufacturing;
 Manufacturing nonalcoholic beers--are classified in Industry 31212, Breweries;
 Manufacturing nonalcoholic wines--are classified in Industry 31213, Wineries; and
 Bottling purchased purified water--are classified in Industry 42449, Other Grocery and Related Products Merchant Wholesalers.

This U.S. industry comprises establishments primarily engaged in manufacturing soft drinks and artificially carbonated waters.
Cross-References. Establishments primarily engaged in--
 Canning fruit and vegetable juices--are classified in U.S. Industry 311421, Fruit and Vegetable Canning;
 Manufacturing fruit syrups for flavoring--are classified in Industry 311930, Flavoring Syrup and Concentrate Manufacturing;
 Manufacturing nonalcoholic cider--are classified in U.S. Industry 311941, Mayonnaise, Dressing, and Other Prepared Sauce Manufacturing;
 Purifying and bottling water (except artificially carbonated and flavored water)--are classified in U.S. Industry 312112, Bottled Water Manufacturing;
 Manufacturing milk based drinks--are classified in U.S. Industry 311511, Fluid Milk Manufacturing;
 Manufacturing nonalcoholic beers--are classified in Industry 312120, Breweries; and
 Manufacturing nonalcoholic wines--are classified in Industry 312130, Wineries.

This industry comprises (1) establishments primarily engaged in finishing textiles, fabrics, and apparel and (2) establishments of converters who buy fabric goods in the grey, have them finished on contract, and sell at wholesale. Finishing operations include: bleaching, dyeing, printing (e.g., roller, screen, flock, plisse), stonewashing, and other mechanical finishing, such as preshrinking, shrinking, sponging, calendering, mercerizing, and napping; as well as cleaning, scouring, and the preparation of natural fibers and raw stock.
Cross-References. Establishments primarily engaged in--
 Coating or impregnating fabrics--are classified in Industry 313320, Fabric Coating Mills;
 Knitting or knitting and finishing fabric--are classified in Industry 313240, Knit Fabric Mills;
 Manufacturing and finishing apparel--are classified in Subsector 315, Apparel Manufacturing;
 Weaving and finishing fabrics--are classified in Industry Group 3132, Fabric Mills;
 Manufacturing and finishing rugs and carpets--are classified in Industry 314110, Carpet and Rug Mills; and
 Printing on apparel--are classified in Industry 32311, Printing.

This industry comprises establishments primarily engaged in manufacturing household textile products, such as curtains, draperies, linens, bedspreads, sheets, tablecloths, towels, and shower curtains, from purchased materials. The household textile products may be made on a stock or custom basis for sale to individual retail customers.
Cross-References. Establishments primarily engaged in--
 Weaving broadwoven fabrics--are classified in Industry 313210, Broadwoven Fabric Mills;
 Manufacturing lace curtains on lace machines--are classified in Industry 313240, Knit Fabric Mills;
 Manufacturing textile blanket, wardrobe, and laundry bags--are classified in Industry 314910, Textile Bag and Canvas Mills; and
 Manufacturing mops--are classified in U.S. Industry 339994, Broom, Brush, and Mop Manufacturing.

This industry comprises establishments commonly referred to as contractors primarily engaged in (1) cutting materials owned by others for apparel and accessories and/or (2) sewing materials owned by others for apparel and accessories.
Cross-References. Establishments primarily engaged in--
 Manufacturing mens and boys apparel from purchased fabric--are classified in Industry 315220, Mens and Boys Cut and Sew Apparel Manufacturing;
 Manufacturing womens, girls, and infants’ apparel from purchased fabric--are classified in Industry 315240, Womens, Girls, and Infants’ Cut and Sew Apparel Manufacturing;
 Manufacturing all other cut and sew apparel from purchased fabric--are classified in Industry 315280, Other Cut and Sew Apparel Manufacturing;
 Manufacturing apparel accessories from purchased fabric--are classified in Industry 315990, Apparel Accessories and Other Apparel Manufacturing; and
 Embroidering apparel on a contract or fee basis for the trade--are classified in U.S. Industry 314999, All Other Miscellaneous Textile Product Mills.

This industry comprises establishments primarily engaged in manufacturing womens, girls, and infants’ apparel from purchased fabric. Womens, girls, and infants’ clothing jobbers, who perform entrepreneurial functions involved in apparel manufacture, including buying raw materials, designing and preparing samples, arranging for apparel to be made from their materials, and marketing finished apparel, are included.
Cross-References. Establishments primarily engaged in--
 Knitting womens, girls, and infants’ apparel or knitting fabric and manufacturing womens, girls, and infants’ apparel--are classified in Industry Group 3151, Apparel Knitting Mills;
 Manufacturing unisex outerwear garments, such as T-shirts, sweatshirts, and sweat pants that are sized without reference to specific gender (i.e., adult S, M, L, XL)--are classified in Industry 315220, Mens and Boys Cut and Sew Apparel Manufacturing;
 Cutting and/or sewing materials owned by others for women’s, girls’, and infants’ apparel--are classified in Industry 315210, Cut and Sew Apparel Contractors;
 Manufacturing fur or leather apparel and team athletic uniforms--are classified in Industry 315280, Other Cut and Sew Apparel Manufacturing; and
 Manufacturing cloth diapers--are classified in U.S. Industry 314999, All Other Miscellaneous Textile Product Mills.

This industry comprises establishments primarily engaged in manufacturing cut and sew apparel from purchased fabric (except mens, boys, womens, girls, and infants’ apparel). Clothing jobbers for these products, who perform entrepreneurial functions involved in apparel manufacture, including buying raw materials, designing and preparing samples, arranging for apparel to be made from their materials, and marketing finished apparel, are included. Examples of products made by these establishments are fur or leather apparel, sheep-lined clothing, team athletic uniforms, band uniforms, academic caps and gowns, clerical vestments, and costumes.
Cross-References. Establishments primarily engaged in--
 Manufacturing mens and boys apparel from purchased fabric--are classified in Industry 315220, Mens and Boys Cut and Sew Apparel Manufacturing;
 Manufacturing womens, girls, and infants’ apparel from purchased fabric--are classified in Industry 315240, Womens, Girls, and Infants’ Cut and Sew Apparel Manufacturing;
 Knitting apparel or knitting fabric and manufacturing apparel--are classified in Industry Group 3151, Apparel Knitting Mills;
 Cutting and/or sewing materials owned by others for apparel--are classified in Industry 315210, Cut and Sew Apparel Contractors;
 Manufacturing fur and leather mittens and gloves--are classified in Industry 315990, Apparel Accessories and Other Apparel Manufacturing; and
 Dyeing and dressing furs--are classified in Industry 316110, Leather and Hide Tanning and Finishing.

This industry comprises establishments primarily engaged in manufacturing apparel and accessories (except apparel knitting mills, cut and sew apparel contractors, mens and boys cut and sew apparel, women’s, girls, and infants’ cut and sew apparel, and other cut and sew apparel). Jobbers, who perform entrepreneurial functions involved in apparel accessories manufacture, including buying raw materials, designing and preparing samples, arranging for apparel accessories to be made from their materials, and marketing finished apparel accessories, are included. Examples of products made by these establishments are belts, caps, gloves (except medical, sporting, safety), hats, and neckties.
Cross-References. Establishments primarily engaged in--
 Cutting and/or sewing materials owned by others for apparel accessories--are classified in Industry 315210, Cut and Sew Apparel Contractors;
 Manufacturing paper hats and caps--are classified in U.S. Industry 322299, All Other Converted Paper Product Manufacturing;
 Manufacturing plastics or rubber hats and caps (except bathing caps)--are classified in Subsector 326, Plastics and Rubber Products Manufacturing;
 Manufacturing athletic gloves, such as boxing gloves, baseball gloves, golf gloves, batting gloves, and racquetball gloves--are classified in Industry 339920, Sporting and Athletic Goods Manufacturing;
 Manufacturing metal fabric, metal mesh, or rubber gloves--are classified in U.S. Industry 339113, Surgical Appliance and Supplies Manufacturing;
 Knitting apparel, mittens, gloves, hats, and caps or knitting fabric and manufacturing apparel, mittens, gloves, hats, and caps--are classified in Industry Group 3151, Apparel Knitting Mills;
 Cutting and/or sewing materials owned by others for apparel--are classified in Industry 315210, Cut and Sew Apparel Contractors;
 Manufacturing mens and boys underwear and outerwear from purchased fabric--are classified in Industry 315220, Mens and Boys Cut and Sew Apparel Manufacturing;
 Manufacturing mens and boys underwear and outerwear from purchased fabric--are classified in Industry 315220, Mens and Boys Cut and Sew Apparel Manufacturing;
 Manufacturing womens, girls, and infants’ underwear and outerwear from purchased fabric--are classified in Industry 315240, Womens, Girls, and Infants’ Cut and Sew Apparel Manufacturing; and
 Manufacturing other apparel from purchased fabric and manufacturing fur and leather apparel--are classified in Industry 315280, Other Cut and Sew Apparel Manufacturing.

This industry comprises establishments primarily engaged in one or more of the following: (1) sawing dimension lumber, boards, beams, timber, poles, ties, shingles, shakes, siding, and wood chips from logs or bolts; (2) sawing round wood poles, pilings, and posts and treating them with preservatives; and (3) treating wood sawed, planed, or shaped in other establishments with creosote or other preservatives to prevent decay and to protect against fire and insects. Sawmills may plane the rough lumber that they make with a planing machine to achieve smoothness and uniformity of size.
Cross-References. Establishments primarily engaged in--
 Operating portable chipper mills in the field--are classified in Industry 11331, Logging;
 Manufacturing wood products (except round wood poles, pilings, and posts) and treating them with preservatives--are classified elsewhere in Subsector 321, Wood Product Manufacturing, based on the related production process;
 Manufacturing veneer from logs and bolts or manufacturing engineered lumber and structural members other than solid wood--are classified in Industry 32121, Veneer, Plywood, and Engineered Wood Product Manufacturing; and
 Planing purchased lumber or manufacturing cut stock or dimension stock (i.e., shapes) from logs or bolts--are classified in Industry 32191, Millwork.

This industry comprises establishments primarily engaged in manufacturing paper from pulp. These establishments may manufacture or purchase pulp. In addition, the establishments may convert the paper they make. The activity of making paper classifies an establishment into this industry regardless of the output.
Cross-References. Establishments primarily engaged in--
 Manufacturing pulp without manufacturing paper--are classified in Industry 32211, Pulp Mills;
 Manufacturing paperboard--are classified in Industry 32213, Paperboard Mills;
 Converting paper without manufacturing paper--are classified in Industry Group 3222, Converted Paper Product Manufacturing; and
 Manufacturing photographic sensitized paper from purchased paper--are classified in Industry 32599, All Other Chemical Product and Preparation Manufacturing.

This U.S. industry comprises establishments primarily engaged in manufacturing paper (except newsprint and uncoated groundwood paper) from pulp. These establishments may manufacture or purchase pulp. In addition, the establishments may also convert the paper they make.
Cross-References. Establishments primarily engaged in--
 Manufacturing newsprint and uncoated groundwood paper--are classified in U.S. Industry 322122, Newsprint Mills;
 Converting paper without manufacturing paper--are classified in Industry Group 3222, Converted Paper Product Manufacturing;
 Manufacturing paperboard--are classified in Industry 322130, Paperboard Mills;
 Manufacturing pulp without manufacturing paper--are classified in Industry 322110, Pulp Mills; and
 Manufacturing photographic sensitized paper from purchased paper--are classified in U.S. Industry 325992, Photographic Film, Paper, Plate, and Chemical Manufacturing.

This U.S. industry comprises establishments primarily engaged in manufacturing newsprint and uncoated groundwood paper from pulp. These establishments may manufacture or purchase pulp. In addition, the establishments may also convert the paper they make.
Cross-References. Establishments primarily engaged in--
 Manufacturing paper (except newsprint and uncoated groundwood)--are classified in U.S. Industry 322121, Paper (except Newsprint) Mills;
 Converting paper without manufacturing paper--are classified in Industry Group 3222, Converted Paper Product Manufacturing;
 Manufacturing paperboard--are classified in Industry 322130, Paperboard Mills; and
 Manufacturing pulp without manufacturing paper--are classified in Industry 322110, Pulp Mills.

This industry comprises establishments primarily engaged in converting paperboard into containers without manufacturing paperboard. These establishments use corrugating, cutting, and shaping machinery to form paperboard into containers. Products made by these establishments include boxes, corrugated sheets, pads, pallets, paper dishes, and fiber drums and reels.
Cross-References. Establishments primarily engaged in--
 Manufacturing similar items of plastics materials--are classified in Industry Group 3261, Plastics Product Manufacturing;
 Manufacturing paperboard and converting paperboard into containers--are classified in Industry 32213, Paperboard Mills;
 Manufacturing egg cartons, food trays, and other food containers from molded pulp--are classified in Industry 32229, Other Converted Paper Product Manufacturing;
 Manufacturing paper and converting paper into containers--are classified in Industry 32212, Paper Mills; and
 Manufacturing paper bags without manufacturing paper--are classified in Industry 32222, Paper Bag and Coated and Treated Paper Manufacturing.

This U.S. industry comprises establishments primarily engaged in converting paperboard (except corrugated) into folding paperboard boxes without manufacturing paper and paperboard.
              Cross-References. Establishments primarily engaged in--
 Manufacturing setup paperboard boxes (except corrugated or laminated solid fiber boxes) or milk cartons--are classified in U.S. Industry 322219, Other Paperboard Container Manufacturing;
 Manufacturing corrugated and solid fiber boxes--are classified in U.S. Industry 322211, Corrugated and Solid Fiber Box Manufacturing;
 Manufacturing paperboard and converting paperboard into containers--are classified in Industry 322130, Paperboard Mills;
 Manufacturing paper and converting paper into containers--are classified in Industry 32212, Paper Mills; and
 Manufacturing paper bags--are classified in Industry 322220, Paper Bag and Coated and Treated Paper Manufacturing.

This industry comprises establishments primarily engaged in one or more of the following: (1) cutting and coating paper and paperboard; (2) cutting and laminating paper, paperboard, and other flexible materials (except plastics film to plastics film); (3) manufacturing bags, multiwall bags, sacks of paper, metal foil, coated paper, laminates, or coated combinations of paper and foil with plastics film; (4) manufacturing laminated aluminum and other converted metal foils from purchased foils; and (5) surface coating paper or paperboard.
Cross-References. Establishments primarily engaged in--
 Manufacturing paper from pulp--are classified in Industry 32212, Paper Mills;
 Manufacturing textile bags--are classified in Industry 314910, Textile Bag and Canvas Mills;
 Manufacturing single wall and multiwall plastics bags--are classified in U.S. Industry 326111, Plastics Bag and Pouch Manufacturing;
 Manufacturing plastics to plastics packaging laminations--are classified in U.S. Industry 326112, Plastics Packaging Film and Sheet (including Laminated) Manufacturing;
 Manufacturing unsupported plastic film--are classified in U.S. Industry 326113, Unlaminated Plastics Film and Sheet (except Packaging) Manufacturing;
 Manufacturing photographic sensitized paper from purchased paper--are classified in U.S. Industry 325992, Photographic Film, Paper, Plate, and Chemical Manufacturing;
 Printing on purchased packaging materials--are classified in Industry 32311, Printing, based on the printing process used;
 Manufacturing foil cookware, dinnerware, and other semi-rigid metal containers--are classified in U.S. Industry 332999, All Other Miscellaneous Fabricated Metal Product Manufacturing;
 Making aluminum and aluminum foil--are classified in Industry 33131, Alumina and Aluminum Production and Processing; and
 Cutting purchased aluminum foil into smaller lengths and widths--are classified in U.S. Industry 332999, All Other Miscellaneous Fabricated Metal Product Manufacturing.

This U.S. industry comprises establishments primarily engaged in converting paper or paperboard into products (except containers, bags, coated and treated paper, stationery products, and sanitary paper products) or converting pulp into pulp products, such as egg cartons, food trays, and other food containers from molded pulp.
Illustrative Examples:
Crepe paper made from purchased paper
Die-cut paper products (except for office use) made from purchased paper or paperboard
Molded pulp products (e.g., egg cartons, food containers, food trays) manufacturing
Paper novelties made from purchased paper
Cross-References. Establishments primarily engaged in--
 Manufacturing pulp from wood or from other materials--are classified in Industry 322110, Pulp Mills;
 Manufacturing paper from pulp or making pulp and manufacturing paper--are classified in Industry 32212, Paper Mills;
 Manufacturing paperboard from pulp or making pulp and manufacturing paperboard--are classified in Industry 322130, Paperboard Mills;
 Manufacturing paperboard containers--are classified in Industry 32221, Paperboard Container Manufacturing;
 Manufacturing bags of coated, laminated, or uncoated paper, of metal foil, or combinations thereof--are classified in Industry 322220, Paper Bag and Coated and Treated Paper Manufacturing; and
 Manufacturing stationery and other related office supplies--are classified in Industry 322230, Stationery Product Manufacturing.

This industry comprises establishments primarily engaged in printing on apparel and textile products, paper, metal, glass, plastics, and other materials, except fabric (grey goods). The printing processes employed include, but are not limited to, lithographic, gravure, screen, flexographic, digital, and letterpress. Establishments in this industry do not manufacture the stock that they print, but may perform postprinting activities, such as folding, cutting, or laminating the materials they print, and mailing.
Cross-References. Establishments primarily engaged in--
 Providing photocopying service on photocopy equipment without performing traditional printing activities--are classified in Industry 56143, Business Service Centers;
 Printing on grey goods--are classified in Industry 31331, Textile and Fabric Finishing Mills;
 Printing and publishing, known as publishers--are classified in Subsector 511, Publishing Industries (except Internet);
 Performing prepress or postpress services without performing traditional printing activities--are classified in Industry 32312, Support Activities for Printing; and
 Manufacturing and printing advertising specialties--are classified in the Manufacturing sector according to the products made.

This U.S. industry comprises establishments primarily engaged in commercial printing (except screen printing, books printing) without publishing (except grey goods printing). The printing processes used in this industry include, but are not limited to, lithographic, gravure, flexographic, letterpress, engraving, and various digital printing technologies. This industry includes establishments engaged in commercial printing on purchased stock materials, such as stationery, invitations, labels, and similar items, on a job-order basis. Establishments primarily engaged in traditional printing activities combined with document photocopying services (i.e., quick printers) or primarily engaged in printing graphical materials using digital printing equipment are included in this industry.
Cross-References. Establishments primarily engaged in--
 Screen printing on purchased stock materials (except books, grey goods, and manifold business forms)--are classified in U.S. Industry 323113, Commercial Screen Printing;
 Printing on grey goods--are classified in Industry 313310, Textile and Fabric Finishing Mills;
 Printing books and pamphlets--are classified in U.S. Industry 323117, Books Printing;
 Manufacturing printed stationery, invitations, labels, and similar items--are classified in Subsector 322, Paper Manufacturing;
 Manufacturing and printing advertising specialties--are classified in the Manufacturing sector according to the products made;
 Providing photocopying service on photocopy equipment without performing traditional printing activities--are classified in U.S. Industry 561439, Other Business Service Centers (including Copy Shops); and
 Printing and publishing, known as publishers--are classified in Subsector 511, Publishing Industries (except Internet).

This U.S. industry comprises establishments primarily engaged in screen printing without publishing (except books, grey goods, and manifold business forms). This industry includes establishments engaged in screen printing on purchased stock materials, such as stationery, invitations, labels, and similar items, on a job-order basis. Establishments primarily engaged in printing on apparel and textile products, such as T-shirts, caps, jackets, towels, and napkins, are included in this industry.
Cross-References. Establishments primarily engaged in--
 Printing on grey goods--are classified in Industry 313310, Textile and Fabric Finishing Mills;
 Printing books and pamphlets--are classified in U.S. Industry 323117, Books Printing;
 Printing manifold business forms including checkbooks--are classified in U.S. Industry 323111, Commercial Printing (except Screen and Books);
 Manufacturing printed stationery, invitations, labels, and similar items--are classified in Subsector 322, Paper Manufacturing;
 Manufacturing and printing advertising specialties--are classified in the Manufacturing sector according to the products made; and
 Printing and publishing, known as publishers--are classified in Subsector 511, Publishing Industries (except Internet).

This industry comprises establishments primarily engaged in performing prepress and postpress services in support of printing activities. Prepress services may include such things as platemaking, typesetting, trade binding, and sample mounting. Postpress services include such things as book or paper bronzing, die cutting, edging, embossing, folding, gilding, gluing, and indexing.
Cross-References. Establishments primarily engaged in--
 Engraving on metal--are classified in U.S. Industry 332812, Metal Coating, Engraving (except Jewelry and Silverware), and Allied Services to Manufacturers;
 Manufacturing photosensitive plates for printing--are classified in U.S. Industry 325992, Photographic Film, Paper, Plate, and Chemical Manufacturing;
 Manufacturing blank plates (except photosensitive plates) for printing--are classified in U.S. Industry 333244, Printing Machinery and Equipment Manufacturing; and
 Printing books or printing and binding books--are classified in U.S. Industry 323117, Books Printing.

This industry comprises establishments primarily engaged in refining crude petroleum into refined petroleum. Petroleum refining involves one or more of the following activities: (1) fractionation; (2) straight distillation of crude oil; and (3) cracking.
Cross-References. Establishments primarily engaged in--
 Manufacturing asphalt paving, roofing, and saturated materials from refined petroleum--are classified in Industry 32412, Asphalt Paving, Roofing, and Saturated Materials Manufacturing;
 Manufacturing paper mats and felts and saturating them with asphalt or tar into rolls and sheets--are classified in U.S. Industry 322121, Paper (except Newsprint) Mills;
 Blending or compounding refined petroleum to make lubricating oils and greases and/or re-refining used petroleum lubricating oils--are classified in U.S. Industry 324191, Petroleum Lubricating Oil and Grease Manufacturing;
 Blending purchased biodiesel fuels and purchased refined petroleum--are classified in U.S. Industry 324199, All Other Petroleum and Coal Products Manufacturing;
 Converting nonpetroleum materials into biodiesel fuels--are classified in U.S. Industry 325199, All Other Basic Organic Chemical Manufacturing;
 Manufacturing synthetic lubricating oils and greases--are classified in U.S. Industry 325998, All Other Miscellaneous Chemical Product and Preparation Manufacturing;
 Recovering natural gasoline and/or liquid hydrocarbons from oil and gas field gases--are classified in Industry 211130, Natural Gas Extraction;
 Manufacturing acyclic and cyclic aromatic hydrocarbons (i.e., petrochemicals) from refined petroleum or liquid hydrocarbons--are classified in Industry 325110, Petrochemical Manufacturing;
 Manufacturing cyclic and acyclic chemicals (except petrochemicals)--are classified in Industry 32519, Other Basic Organic Chemical Manufacturing;
 Manufacturing coke oven products in steel mills--are classified in Industry 331110, Iron and Steel Mills and Ferroalloy Manufacturing; and
 Manufacturing coke oven products in coke oven establishments--are classified in U.S. Industry 324199, All Other Petroleum and Coal Products Manufacturing.

This U.S. industry comprises establishments primarily engaged in manufacturing petroleum products (except asphalt paving, roofing, and saturated materials and lubricating oils and greases) from refined petroleum and coal products made in coke ovens not integrated with a steel mill.
Illustrative Examples:
Biodiesel fuels not made in petroleum refineries and blended with purchased refined petroleum
Coke oven products (e.g., coke, gases, tars) made in coke oven establishments
Petroleum briquettes made from refined petroleum
Petroleum jelly made from refined petroleum
Petroleum waxes made from refined petroleum
Cross-References. Establishments primarily engaged in--
 Manufacturing petroleum products by refining crude petroleum--are classified in Industry 324110, Petroleum Refineries;
 Converting nonpetroleum materials into biodiesel fuels--are classified in U.S. Industry 325199, All Other Basic Organic Chemical Manufacturing;
 Manufacturing asphalt paving and roofing materials from refined petroleum--are classified in Industry 32412, Asphalt Paving, Roofing, and Saturated Materials Manufacturing;
 Blending and compounding petroleum lubricating oils and greases and/or re-refining used petroleum lubrication oils and greases--are classified in U.S. Industry 324191, Petroleum Lubricating Oil and Grease Manufacturing;
 Manufacturing coke oven products in steel mills--are classified in Industry 331110, Iron and Steel Mills and Ferroalloy Manufacturing;
 Manufacturing acyclic and cyclic aromatic hydrocarbons (i.e., petrochemicals) from refined petroleum or liquid hydrocarbons--are classified in Industry 325110, Petrochemical Manufacturing; and
 Manufacturing cyclic and acyclic organic chemicals (except petrochemicals)--are classified in Industry 32519, Other Basic Organic Chemical Manufacturing.

This industry comprises establishments primarily engaged in (1) manufacturing acyclic (i.e., aliphatic) hydrocarbons such as ethylene, propylene, and butylene made from refined petroleum or liquid hydrocarbons and/or (2) manufacturing cyclic aromatic hydrocarbons such as benzene, toluene, styrene, xylene, ethyl benzene, and cumene made from refined petroleum or liquid hydrocarbons.
Cross-References. Establishments primarily engaged in--
 Manufacturing petrochemicals by refining crude petroleum--are classified in Industry 324110, Petroleum Refineries;
 Manufacturing acetylene--are classified in Industry 325120, Industrial Gas Manufacturing;
 Manufacturing basic organic chemicals (except petrochemicals)--are classified in Industry 32519, Other Basic Organic Chemical Manufacturing; and
 Recovering liquid hydrocarbons from oil and gas field gases--are classified in Industry 211130, Natural Gas Extraction.

This industry comprises establishments primarily engaged in manufacturing synthetic organic and inorganic dyes and pigments, such as lakes and toners (except electrostatic and photographic).
Cross-References. Establishments primarily engaged in--
 Manufacturing natural food colorings--are classified in U.S. Industry 311942, Spice and Extract Manufacturing;
 Manufacturing natural organic colorings for nonfood uses (except wood byproducts)--are classified in U.S. Industry 325199, All Other Basic Organic Chemical Manufacturing;
 Manufacturing electrostatic and photographic toners--are classified in U.S. Industry 325992, Photographic Film, Paper, Plate, and Chemical Manufacturing;
 Manufacturing wood byproducts used as dyeing materials--are classified in U.S. Industry 325194, Cyclic Crude, Intermediate, and Gum and Wood Chemical Manufacturing; and
 Manufacturing carbon, bone, and lamp black--are classified in Industry 325180, Other Basic Inorganic Chemical Manufacturing.

This industry comprises establishments primarily engaged in manufacturing basic inorganic chemicals (except industrial gases and synthetic dyes and pigments).
Illustrative Examples:
Alkalies manufacturing
Aluminum compounds, not specified elsewhere by process, manufacturing
Carbides (e.g., baron, calcium, silicon, tungsten) manufacturing
Carbon black manufacturing
Chlorine manufacturing
Hydrochloric acid manufacturing
Potassium inorganic compounds, not specified elsewhere by process, manufacturing
Radioactive isotopes manufacturing
Sulfides and sulfites manufacturing
Sulfuric acid manufacturing
Cross-References. Establishments primarily engaged in--
 Manufacturing industrial gases--are classified in Industry 325120, Industrial Gas Manufacturing;
 Manufacturing inorganic dyes and pigments--are classified in Industry 325130, Synthetic Dye and Pigment Manufacturing;
 Manufacturing household bleaches--are classified in U.S. Industry 325612, Polish and Other Sanitation Good Manufacturing;
 Mining and/or beneficiating alkalies--are classified in U.S. Industry 212391, Potash, Soda, and Borate Mineral Mining;
 Manufacturing chlorine preparations (e.g., for swimming pools)--are classified in U.S. Industry 325998, All Other Miscellaneous Chemical Product and Preparation Manufacturing;
 Manufacturing nitrogenous and phosphoric fertilizers and fertilizer materials--are classified in Industry 32531, Fertilizer Manufacturing;
 Manufacturing pharmaceuticals, medicines, and dietary supplements--are classified in Industry Group 3254, Pharmaceutical and Medicine Manufacturing;
 Manufacturing aluminum oxide (alumina)--are classified in U.S. Industry 331313, Alumina Refining and Primary Aluminum Production;
 Manufacturing inorganic insecticidal, herbicidal, fungicidal and pesticidal preparations--are classified in Industry 325320, Pesticide and Other Agricultural Chemical Manufacturing; and
 Manufacturing photographic chemicals--are classified in U.S. Industry 325992, Photographic Film, Paper, Plate, and Chemical Manufacturing.

This industry comprises establishments primarily engaged in manufacturing basic organic chemicals (except petrochemicals, industrial gases, and synthetic dyes and pigments).
Illustrative Examples:
Biodiesel fuels not made in petroleum refineries and not blended with petroleum
Carbon organic compounds, not specified elsewhere by process, manufacturing
Cyclic intermediates made from refined petroleum or natural gas (except aromatic petrochemicals)
Enzyme proteins (i.e., basic synthetic chemicals) (except pharmaceutical use) manufacturing
Gum and wood chemicals manufacturing
Fatty acids (e.g., margaric, oleic, stearic) manufacturing
Organo-inorganic compound manufacturing
Plasticizers (i.e., basic synthetic chemical) manufacturing
Silicone (except resins) manufacturing
Synthetic sweeteners (i.e., sweetening agents) manufacturing
Cross-References. Establishments primarily engaged in--
 Manufacturing petrochemicals from refined petroleum or liquid hydrocarbons--are classified in Industry 32511, Petrochemical Manufacturing;
 Manufacturing petrochemicals by refining crude petroleum--are classified in Industry 32411, Petroleum Refineries;
 Blending purchased biodiesel fuels and purchased refined petroleum--are classified in Industry 32419, Other Petroleum and Coal Products Manufacturing;
Manufacturing organic industrial gases--are classified in Industry 32512, Industrial Gas Manufacturing;
 Manufacturing synthetic organic dyes and pigments--are classified in Industry 32513, Synthetic Dye and Pigment Manufacturing;
 Manufacturing natural glycerin--are classified in Industry 32561, Soap and Cleaning Compound Manufacturing;
 Manufacturing activated charcoal--are classified in Industry 32599, All Other Chemical Product and Preparation Manufacturing;
 Manufacturing organic insecticidal, herbicidal, fungicidal, and pesticidal preparations--are classified in Industry 32532, Pesticide and Other Agricultural Chemical Manufacturing;
 Manufacturing elastomers--are classified in Industry 32521, Resin and Synthetic Rubber Manufacturing;
 Manufacturing urea--are classified in Industry 32531, Fertilizer Manufacturing;
 Manufacturing pharmaceuticals, medicines, and dietary supplements--are classified in Industry Group 3254, Pharmaceutical and Medicine Manufacturing;
 Manufacturing coal tar crudes in integrated steel mills with coke ovens--are classified in Industry 33111, Iron and Steel Mills and Ferroalloy Manufacturing;
 Manufacturing coal tar crudes in coke ovens not integrated with steel mills and fuel briquettes from refined petroleum--are classified in Industry 32419, Other Petroleum and Coal Products Manufacturing; and
 Manufacturing natural food colorings--are classified in Industry 31194, Seasoning and Dressing Manufacturing

This U.S. industry comprises establishments primarily engaged in one or more of the following: (1) distilling wood or gum into products, such as tall oil and wood distillates; (2) distilling coal tars; (3) manufacturing wood or gum chemicals, such as naval stores, natural tanning materials, charcoal briquettes, and charcoal (except activated); and (4) manufacturing cyclic crudes or cyclic intermediates (i.e., hydrocarbons, except aromatic petrochemicals) from refined petroleum or natural gas.
Cross-references. Establishments primarily engaged in--
 Manufacturing cyclic chemicals (except aromatic and intermediates)--are classified in U.S. Industry 325199, All Other Basic Organic Chemical Manufacturing;
